<template>
  <div class="poetry">
	<div class="content">
		<span v-for="(item,index) in list" :key="index" class="span">
			{{item}}
		</span>
	</div>
	<view @click="generate" class="btn"></view>
	
  </div>
</template>
<script>
import json from "./p.json";
export default {
  data() {
    return {
      list: [],
	  
    };
  },
  onLoad() {
    // console.log('json',json);
	uni.showShareMenu({
	  menus: ["shareAppMessage", "shareTimeline"],
	}); //可分享
	this.generate()
  },
  methods: {
    generate() {
      const length = json.length;
      let arr=[],poetryList=[]
      for (let i = 0; i < 6; i++) {
        // console.log(i);
        const index = Math.round(Math.random() * length);
		 // console.log(i,index,json);
        if(!arr.includes(index)){
            arr.push(index)
            poetryList.push(json[index])
        }else{
            i--
        }
      }
      // console.log(arr,poetryList);
	  this.list=poetryList
    },
  },
};
</script>
